create database ecommerce_database;
use ecommerce_database;
CREATE TABLE Users (
    id INT AUTO_INCREMENT PRIMARY KEY,
    name VARCHAR(100),
    email VARCHAR(100),
    password VARCHAR(255),
    contact_number VARCHAR(50),
    address TEXT,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);


select * from users;




CREATE TABLE Products (
    pd_id INT AUTO_INCREMENT PRIMARY KEY,
    name VARCHAR(100),
    description TEXT,
    price DECIMAL(10, 2),
    stock_quantity INT,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);


select * from products;


CREATE TABLE Order_Items (
    order_id INT auto_increment primary key,
    pd_id INT,
    quantity INT,
    price DECIMAL(10, 2),
    FOREIGN KEY (pd_id) REFERENCES Products(pd_id)

);


select * from order_items;


CREATE TABLE Orders (
    id INT AUTO_INCREMENT PRIMARY KEY,
    user_id INT,
    pd_id INT,
    total_price DECIMAL(10, 2),
    order_status ENUM('pending', 'completed', 'canceled') DEFAULT 'pending',
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (user_id) REFERENCES Users(id),
    FOREIGN KEY (pd_id) REFERENCES Products(pd_id)
);


select * from orders
where order_status = 'completed';

SELECT id AS user_id, name AS user_name, email
FROM Users
WHERE id IN (
    SELECT user_id
    FROM Orders
    WHERE order_status = 'completed'    
);

SELECT 
    u.id AS user_id,
    u.name AS user_name,
    u.email,
    COUNT(o.id) AS completed_orders
FROM Users u
JOIN Orders o ON u.id = o.user_id
WHERE o.order_status = 'completed'
GROUP BY u.id, u.name, u.email;



SELECT id AS user_id, name AS user_name, email
FROM Users
WHERE id IN (
    SELECT user_id
    FROM Orders
    WHERE order_status = 'completed'    
);
 UPDATE Orders
SET order_status = 'completed'
WHERE id = 101; 

